USE ToTheRescue
/************************************************************
* Purpose: Tests the GetCurrentAnimal Function
* should return a row from the Animals table
************************************************************/
DROP TABLE #temp

CREATE TABLE #temp([Images] VARBINARY(MAX))
INSERT INTO #temp
VALUES();

IF(SELECT COUNT(*) AS UnMatchedCurrentAnimal
FROM dbo.GetCurrentAnimal(2) AS retTable
	FULL OUTER JOIN (SELECT *
	   	  FROM #temp) AS expected ON (retTable.Images = expected.[Images])
WHERE (retTable.Images IS NULL OR expected.[Images] IS NULL))
	 > 0
	PRINT 'Failure, didn''t return correct Current Animal'
ELSE
	PRINT 'Success, correct Current Animal returned'
DROP TABLE #temp; --drop temp table


/************************************************************
* Purpose: Tests the GetProfile Function
* should return a row from the profile table
************************************************************/
DROP TABLE #temp

CREATE TABLE #temp(ProfileName NVARCHAR(30), AvatarID INT, ReadingDifficultyLevel INT
			,  MathDifficultyLevel INT, ReadingPerformanceStat INT, MathPerformanceStat INT
			, SubjectFilter VARCHAR(50), ToggleSound BIT, ToggleMusic BIT,)
INSERT INTO #temp
VALUES (N'Emma', 1, 3, 1, 36, 12, '0', 1, 0);

IF(SELECT COUNT(*) AS UnMatchedProfile
FROM dbo.GetProfile(2) AS retTable
	FULL OUTER JOIN (SELECT *
	   	  FROM #temp) AS expected 
		  ON (retTable.ProfileName = expected.ProfileName
			AND retTable.AvatarID = expected.AvatarID
			AND retTable.MathDifficultyLevel = expected.MathDifficultyLevel
			AND retTable.ReadingDifficultyLevel = expected.ReadingDifficultyLevel
			AND retTable.MathPerformanceStat = expected.MathPerformanceStat
			AND retTable.ReadingPerformanceStat = expected.ReadingPerformanceStat
			AND retTable.SubjectFilter = expected.SubjectFilter
			AND retTable.ToggleSound = expected.ToggleSound
			AND retTable.ToggleMusic = expected.ToggleMusic)
WHERE (retTable.ProfileName IS NULL 
		OR retTable.AvatarID IS NULL 
		OR retTable.MathDifficultyLevel IS NULL 
		OR retTable.ReadingDifficultyLevel IS NULL 
		OR retTable.MathPerformanceStat IS NULL 
		OR retTable.ReadingPerformanceStat IS NULL 
		OR retTable.SubjectFilter IS NULL 
		OR retTable.ToggleSound IS NULL 
		OR retTable.ToggleMusic IS NULL) 
		OR 
		(expected.ProfileName IS NULL 
		OR expected.AvatarID IS NULL 
		OR expected.MathDifficultyLevel IS NULL
		OR expected.ReadingDifficultyLevel IS NULL
		OR expected.MathPerformanceStat IS NULL
		OR expected.ReadingPerformanceStat IS NULL  
		OR expected.SubjectFilter IS NULL 
		OR expected.ToggleMusic IS NULL 
		OR expected.ToggleSound IS NULL))
	 > 0
	PRINT 'Failure, didn''t return correct Profile members'
ELSE
	PRINT 'Success, correct Profile members returned'
DROP TABLE #temp; --drop temp table


/************************************************************
* Purpose: Tests the GetAvatar Function
* should return the avatar image 
************************************************************/
DROP TABLE #temp

CREATE TABLE #temp([Images] VARBINARY(MAX))
INSERT INTO #temp
VALUES();

IF(SELECT COUNT(*) AS UnMatchedAvatar
FROM dbo.GetProfileAvatar(2) AS retTable
	JOIN (SELECT *
	   	  FROM #temp) AS expected ON (retTable.Images = expected.[Images])
WHERE (retTable.Images IS NULL OR expected.[Images] IS NULL))
	 > 0
	PRINT 'Failure, didn''t return correct Avatar Image'
ELSE
	PRINT 'Success, correct Avatar image returned'
DROP TABLE #temp; --drop temp table

--====================================
-- This try catch block creates profiles with a specified UserID 
-- until the ninth profile is created and the trigger catches it
--====================================
USE ToTheRescue;
BEGIN TRY
	WHILE 
		(SELECT COUNT(ProfileID)
		FROM Profiles
		WHERE UserID = 12) < 9
	BEGIN
		INSERT INTO Profiles
		(UserID, AvatarID, ProfileName, ToggleSound, ToggleMusic, SubjectFilter)
		VALUES
		(12, 1, 'ASUYWEIURWIEURYWIE', 1, 1, 1)
	END
	DELETE Profiles
	WHERE Profiles.ProfileName = 'ASUYWEIURWIEURYWIE'
	PRINT 'Failure, 9th profile was added to the Profiles Table';
END TRY
BEGIN CATCH
	DELETE Profiles
	where Profiles.ProfileName = 'ASUYWEIURWIEURYWIE'
	PRINT 'Success, 9th profile was removed from the Profiles Table';
	PRINT 'Error ' + CONVERT(varchar, ERROR_NUMBER(), 1)
		+ ': ' + ERROR_MESSAGE();
END CATCH
PRINT '--------------------------------------------------------'

--====================================
-- This try catch block creates animals with a specified ProfileID
-- until the 21st animal is created and the trigger catches it and converts active bit to 0 (non active)
--====================================
USE ToTheRescue;

WHILE 
	(SELECT COUNT(AnimalID)
	FROM ProfileAnimals
	WHERE ProfileID = 28) < 21
BEGIN
	INSERT INTO ProfileAnimals
	(AnimalID, ProfileID)
	VALUES
	(5, 28)
END
BEGIN
	IF EXISTS (SELECT MIN(ProfileAnimalID)
				FROM ProfileAnimals
				WHERE ProfileID = 28
				AND Active = 0)
		PRINT 'Success, oldest Animal in sanctuary became non active after 20 animals';
	ELSE
		PRINT 'Failure, oldest animal remained active in the sanctuary (ew)';
		PRINT 'Error ' + CONVERT(varchar, ERROR_NUMBER(), 1)
		+ ': ' + ERROR_MESSAGE();

	PRINT '---------------------------------------------------------------'
END
DELETE ProfileAnimals 
WHERE ProfileID = 28 
AND AnimalID = 5